// src/pages/Home.js
import React from 'react';
import './Home.css'; // Add a separate CSS file for specific styling

function Home() {
  return (
    <div className="home">
      <div className="home-overlay">
        <h1 className="home-heading">Welcome to My Portfolio</h1>
        <p className="home-intro">Hi, I'm [Your Name], a [Your Profession]</p>
        <button className="home-button" onClick={() => window.location.href='/projects'}>View My Projects</button>
      </div>
    </div>
  );
}

export default Home;
